const Part =({parts}) => {

    return ( 
        <>
        {parts.map( part => <p key={part.id}>{part.name} {part.exercises} </p>)}
        {
            parts.reduce ( (s,p) => {

                return s + p.exercises
            },0)
        }
        </>
    )
}


export default Part
